import styled from "styled-components";
import MyWallet from "../assets/MyWallet.png";

const BigLogo = styled.div`
  width: 147px;
  height: 50px;

  background-image: url(${MyWallet});
  background-repeat: no-repeat;
`;

export default BigLogo;
